Train (2008)  

Verenigde Staten
Horror / Thriller
94 minuten

geregisseerd door Gideon Raff
met Thora Birch, Gideon Emery en Derek Magyar

Een groep jonge Amerikaanse atleten heeft een wedstrijd in Oost Europa, maar dan missen de jongeren plotseling hun trein. Ze besluiten om een andere trein te nemen, zodat ze alsnog op tijd kunnen aankomen voor hun wedstrijd. Maar het duurt niet lang voordat ze ontdekken dat er een moordenaar aan boord is, die het op de arme tieners heeft voorzien.

